import React,{useNavigate,useContext} from 'react'

function Logout() {
    const navigate=useNavigate()
  return (
    <div>
        <h2>Are you sure ?</h2>
        <div className="btn">
            <button>Yes</button>
            <button onClick={navigate('/')}>No</button>
        </div>
    </div>
  )
}

export default Logout
